import React from 'react';
import Todo from './Todo';

const TodoList = ({todos,setTodos}) =>{
  console.log(todos)
  return(

        <div className="todo-container">
              <ul className="todo-item">
                  {todos.map(todo=>(
                    <Todo key={todo.id}
                          text={todo.text}
                          setTodos={setTodos}
                          todos={todos}
                          todo={todo}
                    />
                  ))}

              </ul>
              <br/>
        </div>

  );
};
export default TodoList;
